import {BiSearch} from "react-icons/bi"
import styles from "../styles/SearchBar.module.scss"

const SearchBar = () => {
    return (
        <>
        <input type="text" className={styles.searchbar}>
            <BiSearch /></input>
        </>
    )
}

export default SearchBar
